		END IF;
   ELSEIF VV_QUESTION_ID IS NOT NULL AND VV_QUESTION_ID <> -1 THEN
		SELECT COUNT(*) INTO VV_QUESTION_ID_COUNT FROM TB_QUESTION T WHERE T.QUESTION_ID_PK=VV_QUESTION_ID;
		IF VV_QUESTION_ID_COUNT=1 THEN /* INSERT IF START */
			UPDATE TB_QUESTION SET
                QUESTION_DESCRIPTION	=  VV_QUESTION_DESCRIPTION, 
                DEPART_ID_FK  			=  VV_DEPART_ID, 
