    IN VV_EXAM_NAME			varchar(2000),
    IN VV_DEPART_ID				INT,
    IN VV_TOTAL_EXAM_MARK		INT,
    IN VV_IS_QUES_OPTIONAL_AVAI	VARCHAR(255),
    IN VV_QUESTION_LIST			Int,
    OUT PO_RESPONCE_ID 			INT,
	OUT PO_SUCCESS_FLAG  		INT,
	OUT PO_MESSAGE 				VARCHAR(255)
)
BEGIN
	DECLARE VV_TABLE_NAME varchar(2000)  DEFAULT "pkg_create_update_ques_paper";
    DECLARE vv_QUESTION_id_count INT DEFAULT 0;
	DECLARE iv_new_exam_id INT DEFAULT 0;
    DECLARE iv_new_exam_ques_list_id INT DEFAULT 0;
	DECLARE _index INT DEFAULT 0;
    -- DECLARE json_items INT DEFAULT JSON_LENGTH(VV_QUESTION_LIST);
	DECLARE EXIT HANDLER FOR SQLEXCEPTION
	BEGIN 
		DECLARE errno INT;
		DECLARE msg TEXT;
		DECLARE full_error TEXT;
		DECLARE sqlstate1 TEXT; 
		GET DIAGNOSTICS CONDITION 1 sqlstate1 = RETURNED_SQLSTATE, errno = MYSQL_ERRNO, msg = MESSAGE_TEXT;
		SET full_error = CONCAT("ERROR ", @errno, " (", @sqlstate, "): ", @text , " Line No: " , IFNULL( @msg , -1));
        insert into tba_error_log(Error_details, Error_Description)
        values(VV_TABLE_NAME, full_error);
        COMMIT;
    END;
     IF VV_QUESTION_PAPER_ID = -1 AND VV_QUESTION_PAPER_ID is not null  then
		  select count(*) INTO vv_QUESTION_id_count from tb_exam_list t where t.Exam_id_pk=VV_QUESTION_PAPER_ID;
		IF vv_QUESTION_id_count=0 THEN /* insert if start */
			select ifnull((max(Exam_id_pk)),0)+1 into iv_new_exam_id from tb_exam_list;
            insert into tb_exam_list (Exam_id_pk, Exam_name, Depart_id_fk, Total_mark, IS_Optional_support, is_active) 
            values (iv_new_exam_id, VV_EXAM_NAME ,VV_DEPART_ID, VV_TOTAL_EXAM_MARK, VV_IS_QUES_OPTIONAL_AVAI, 'Y');
            commit;
			
			select count(*) INTO _index from tl_exam_question_list t where t.Exam_id_fk=iv_new_exam_id and question_id_fk=VV_QUESTION_LIST;
			IF _index = 0 then
				select ifnull((max(exam_ques_id_pk)),0)+1 into iv_new_exam_ques_list_id from tl_exam_question_list;
				insert into tl_exam_question_list (exam_ques_id_pk, Exam_id_fk, question_id_fk) 
