				values (iv_new_exam_ques_list_id, iv_new_exam_id,  VV_QUESTION_LIST);
			end if;
            commit;
		END IF;
     ElseIF VV_QUESTION_PAPER_ID != -1 AND VV_QUESTION_PAPER_ID is not null then 
		      
			select count(*) INTO _index from tl_exam_question_list t where t.Exam_id_fk=VV_QUESTION_PAPER_ID and question_id_fk=VV_QUESTION_LIST;
			set iv_new_exam_id = VV_QUESTION_PAPER_ID ;
            IF _index = 0 then
				select ifnull((max(exam_ques_id_pk)),0)+1 into iv_new_exam_ques_list_id from tl_exam_question_list;
