				values (iv_new_exam_ques_list_id, iv_new_exam_id,  VV_QUESTION_LIST);
			end if;
            commit;
     END IF;
    
   set PO_RESPONCE_ID= iv_new_exam_id;
   set po_message = 'success';
   set PO_SUCCESS_FLAG = 1;
        commit;    
